    false,nt"url": null,nt"notes": "The objectives of this vegetative study
    on St. Vincent National Wildlife Refuge were to: (1) identify and describe the major
    plant communities and associations on the refuge and (2) delineate the major plant
    communities on a map and/or photomosaic.  The vegetative cover on St. Vincent Island
    presents a very unique and interesting ecological complex. A Sand Pine-Scrub Oak
    plant association is present in old dunes from Carabelle to East Point, Florida
    yet only a small area of this association is found on the island. Several fairly
    large, nearly pure stands of Cabbage Palm are found on the island.  The vegetative
    types found on the refuge are quite distinctive in their alignment with the dunes
    as cross sectioned from north to south.",nt"license_title": "License Not Specified",nt"extras":
